import React from 'react';

// import styles from MUI
import Typography from '@material-ui/core/Typography';
import Paper from '@material-ui/core/Paper';
import { makeStyles } from '@material-ui/core/styles';

// import files
import styles from '../../assets/jss/components/list/dashlistStyle.js';

const useStyles = makeStyles(styles);

export default function DashActivityList(props) {
    const classes = useStyles();

    var calendarList = (
        <List className={classes.list}>
            {props.routes.map((prop, index) => {
                return (
                    // create the href for the list item
                    <Link
                        to={prop.path}
                        className={classes.item}
                        key={index}
                    >
                        <ListItem
                            button
                            selected={selectedIndex === index}
                            className={
                                classNames(classes.drawerButton)
                            }
                            key={prop.name}
                            onClick={(event) => handleListItemClick(event, index)}
                        >
                            <prop.icon
                                className={classes.buttonIcon}
                                fontSize="large"
                            />
                            <ListItemText
                                disableTypography
                                className={classes.buttonText}
                                primary={prop.name}
                            />
                        </ListItem>
                    </Link>
                );
            })}
        </List>
    );
    return (
        <Paper>
            <Typography className={classes.listTitle} variant="h6">Activity</Typography>
            <Paper elevation={3}>
                {calendarList}
            </Paper>
        </Paper>
    );
}
